riot.tag('create', '<form name="frmCreate" onsubmit="{ create }"> <h2>Create Project</h2> <label>Project title</label><br> <input type="text" name="title" placeholder="Project name" require><br> <label>Start date</label><br> <input type="date" name="dateStart" require><br> <label>End date</label><br> <input type="date" name="dateEnd" require><br> <label>Site name</label><br> <input type="text" name="site" placeholder="Site name"><br> <label>Site location</label><br> <div id="mapCanvas"></div> <button type="button" onclick="{ resetMap }">Reset map</button><br> <label>Lat / Lng</label><br> <input type="text" name="latlng" placeholder="Click map to set…" disabled><br> <label>Country</label><br> <input type="hidden" name="countryIso"> <input type="hidden" name="countryName"> <input type="text" name="countryDisplay" placeholder="Click map to set…" disabled><br> <label>Timezone</label><br> <input type="text" name="tzId" placeholder="Click map to set…" disabled><br> <label>UTC offset</label><br> <input type="hidden" name="tzAbbr"> <input type="hidden" name="tzOffset"> <input type="text" name="tzDisplay" placeholder="Click map to set…" disabled><br> <label>Privacy</label><br> <input type="radio" name="privacy" value="public" checked> Public <input type="radio" name="privacy" value="private"> Private<br> <button type="submit">Create project</button> <button type="button" onclick="{ resetForm }">Reset</button> </form>', function(opts) {
        var riotcontrol = require('riotcontrol')
        var utils = require('../../utils')
        var moment = require('moment')
        var self = this
        self.date = {}

        this.checkDates = function() {
            self.date.created = moment().unix()
            self.date.start = moment(self.dateStart.value).unix()
            self.date.end = moment(self.dateEnd.value).unix()
            return (self.date.start >= self.date.end)
        }.bind(this);

        this.create = function() {
            if (self.checkDates()) {
                var msg = 'Please correct; Start date cannot be later than, or equal to, End date.'
                riotcontrol.trigger('alert', msg, 'warning')
                return
            }

            var project = {
                title: self.title.value,
                site: self.site.value,
                latlng: self.latlng.value,
                country: {
                    id: self.countryIso.value,
                    name: self.countryName.value
                },
                tz: {
                    id: self.tzId.value,
                    abbr: self.tzAbbr.value,
                    offset: self.tzOffset.value
                },
                date: self.date,
                privacy: utils.radioBtnVal('privacy')
            }

            riotcontrol.trigger('alert_clear')
            riotcontrol.trigger('project_create', project)
            self.frmCreate.reset()
        }.bind(this);

        this.resetForm = function() {
            self.frmCreate.reset()
            self.resetMap()
        }.bind(this);

        this.resetMap = function() {
            riotcontrol.trigger('map_reset')
        }.bind(this);

        this.setMapData = function(data) {
            var iso = data.countryIso || ''
            var name = data.countryName || ''
            var latlng = data.latLng || ''
            var display = name && iso ? name + ',' + iso : ''

            self.countryIso.value = iso
            self.countryName.value = name
            self.countryDisplay.value = display
            self.latlng.value = latlng
        }.bind(this);

        this.setTzData = function(data) {
            var tz = data.tz || ''
            var abbr = data.abbr || ''
            var offset = data.offset || ''
            var display = offset && abbr ? offset + ', ' + abbr : ''

            self.tzId.value = tz
            self.tzAbbr.value = abbr
            self.tzOffset.value = offset
            self.tzDisplay.value = display
        }.bind(this);

        riotcontrol.on('map_data', self.setMapData)
        riotcontrol.on('map_tzData', self.setTzData)

        self.on('mount', function() {
            riotcontrol.trigger('map_init')
        })

});
